import React, { Component } from "react";
import HomeStyle from "./style";
import axios from "axios";

export default class Home extends Component {
  constructor() {
    super();
    this.state = {
      pizzas: [],
    };
  }

  componentDidMount = async () => {
    let pizzas = await axios.get(`http://localhost:8000/api/pizzas`);
    this.setState({ pizzas: pizzas.data });
  };

  render() {
    return (
      <HomeStyle>
        {this.state.users.length !== 0
          ? this.state.users.map((val, key) => (
              <div className="users" key={key}>
                <p>Name: {val.customer_name}</p>
                <p>Email: {val.customer_address}</p>
              </div>
            ))
          : "No users!"}
      </HomeStyle>
    );
  }
}
